// import '../css/Music.css'
import env from 'react-dotenv'
import SongChoice from '../pages/SongChoice'
import { Link } from 'react-router-dom'


const MySongs = () => {

    // const[allSongs, setAllSongs] = useState(null)

    const[allUserSongs, setAllUserSongs] = useState(null)
    const userId = localStorage.getItem('userId')


    const getAllSongs = async() => {
            try {
            const res = await axios.get(`${env.API_URL}/songs`)
            console.log(res)
            // setAllSongs(res.data)
            setAllUserSongs(() =>
            res.data)
            console.log(res.data)
            console.log(userId)
            } catch (error) {
            console.log(error)

            }


    }

    useEffect(() => {
        getAllSongs()
    },[])



    return (
        <>
        <h1>Check Out These from the Community!</h1>
        <h3>Title | Genre</h3>


        {allUserSongs && allUserSongs.map((res, i) => {
        return (
            <li key={res.id}>
                <Link to={`/songs/${res.id}`} className="communitySongs">
                <SongChoice
                key={res.id}
                song={res}
                userId={res.userId}
                preview="true"
                placeholder={res.title}
                />
                {res.title} | {res.genre}</Link>
            </li>

            )})

        }
        </>
    )
}

export default MySongs
